      nom : ''
    }

    this.handleChange = this.handleChange.bind(this)
  }

  handleChange(e){
    this.setState({
      nom : e.target.value
    })

    console.log(e)
  }


  
  testF(){
    return <UserGithub nom={'ines'}/>
   }
   
  render(){

    

    return (
      
      <div className='main'>
        
        <label htmlFor="nom">Nom de user</label>
